import React, { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCalendar, faClock } from '@fortawesome/free-solid-svg-icons';
import Layout from "../../components/layout/Layout";
import Header from "../../components/header/Header";
import TextInput from "../../components/inputs/TextInput";
import DateInput from '../../components/inputs/DateInput';
import BigInput from '../../components/inputs/BigInput';
import Button from '../../components/buttons/Button';
import TimeInput from '../../components/inputs/TimeInput';
import { useNavigate, useParams } from 'react-router-dom';
import { useDataContext } from '../../services/DataContext';
import { useForm } from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
import * as yup from 'yup';
import axios from 'axios';
import "../EditService/editService.css"

const EditService = () => {
    const { id } = useParams();
    const { data, editService } = useDataContext();
    const navigate = useNavigate();

    const serviceToEdit = data.find(service => service.id === id);

    const [service, setService] = useState(serviceToEdit)

    console.log(service.titulo)

    useEffect(() => {
        const fetchServiceDetails = async () => {
          try {
            const response = await axios.get(`http://localhost:3001/instrutor/registro/123456/${id}`);
            setService(response.data.data);
            console.log(response.data.data)
          } catch (error) {
            console.error('Erro ao buscar detalhes do servi√ßo:', error);
          }
        };
    
        fetchServiceDetails();
      }, [id]);

    if (!service){
        return (
            <h1>Carregando...</h1>
        )
    }

    return (
        <Layout>
            <Header title="Editar Servi√ßo Educacional" description="Preencha os dados e edite seu registro de servi√ßo educacional"/>
            <main>
                <div className="createServiceForm-container">
                    <div className="createServiceForm-header">
                        <p>Edite as Informa√ß√µes do Seu Servi√ßo Educacional</p>
                        <div className="createServiceForm-header-info">
                        <h3>T√≠tulo:</h3>{service ? <span>{service.titulo}</span>: null}
                        </div>
                        <hr />
                    </div>
                    <div className="createServiceForm-body">
                        <form>
                            <label htmlFor="">T√≠tulo do Servi√ßo Educacional</label>
                            <TextInput placeholder= "T√≠tulo do Servi√ßo Educacional Prestado"/>
                            <div className="dateInput-container">
                                <label htmlFor=""><FontAwesomeIcon icon={faCalendar} className="icon"/>Data</label>
                                <DateInput />
                            </div>
                            <div className="timeInput-container">
                                <div className="timeInput-box">
                                    <label htmlFor=""><FontAwesomeIcon icon={faClock} className="icon"/>In√≠cio (Hora)</label>
                                    <TimeInput />
                                </div>
                                <div className="timeInput-box">
                                    <label htmlFor=""><FontAwesomeIcon icon={faClock} className="icon"/>Fim (Hora)</label>
                                    <TimeInput />
                                </div>
                            </div>

                            <div className="selectInput-container">
                            <label htmlFor="">Selecione a Atividade:</label>
                            <select name="" id="">
                                <option value="">Escolha</option>
                            </select>
                            </div>
                                                      
                            <div className="descriptionInput-container">
                                <label htmlFor="">Descri√ß√£o da Atividade:</label>
                                <BigInput placeholder="Descreva a atividade realizada com pelo menos 50 palavras" />
                            </div>
                            
                            <Button title="Editar" size="medium"/>
                        </form>
                    </div>
                </div>
            </main>
        </Layout>
    )
}

export default EditService;
